import React, {Component, Fragment} from 'react';
import Header from "./Components/Header";
import YogaGallery from "./Components/YogaGallery";

class App extends Component {
    render() {
        return (
           <Fragment>
               <Header/>
               <YogaGallery />
           </Fragment>
        );
    }
}

export default App;
